import './App.css';
import Sidebar from './Components/sidebar';
import CreatePostModal from './Components/Post';
import Home from './Pages/Home';
import Explore from './Pages/explore';

function App() {
  return (
    <div className="container-fluid">
      <div className="row">
      <div className="col-auto col-md-3 col-xl-3 px-sm-2 px-0 bg-black">
          <Sidebar />
        </div>
        <div className="col-md-9 col-xl-9 px-sm-10 ">
          <Home />
          <Explore></Explore>
        </div>
      </div>

    </div>
  );
}

export default App;
